import Navbar from "../components/ourNavbar/index";
import { Container, Row, Col } from 'react-bootstrap';
import CardDeck from "../components/CardDeck/index";
import Card from "../components/Card/index";
import Button from 'react-bootstrap/Button';
import Footer from "../components/Footer/Index"



function Dashboard() {
    return (
        <div>
            <Navbar />
            <Container>
                <h1>Your Dashboard:</h1>
                <Button variant="outline-warning" style={{margin: "20px"}}>View trends</Button>
                <Button variant="outline-success">View Products</Button>
                <CardDeck />
                <CardDeck />
            </Container>



        </div>
    )
}

export default Dashboard;
